import React from "react";

export default function Navbar() {
    return(
        <nav className="navbar">
            <img className="react-logo" src="https://upload.wikimedia.org/wikipedia/commons/a/a7/React-icon.svg" alt="react logo"/>
            <span className="react-title">ReactFacts</span>
            <label className="switch">
                <span>Light</span>
                <input type="checkbox"/>
                <span class="slider round">Dark</span>
            </label>
        </nav>
    )
}
